 const AddUser = () => {
    return(
        <div className="container">
            <h3 className="mt-3">Add student</h3>
            <div className="form-group">
                <input
                    type="text"
                    className="form-control form-control-lg"
                    placeholder="First Name"
                    name="name"
                />

            </div>

        </div>
    )
 };
export default AddUser;
